import React from 'react';
import {
  Switch,
  Route,
} from 'react-router-dom';
import Login from './pages/login';
import Game from './pages/game';

function App() {
  return (
    <Switch>
      <Route exact path="/" component={ Login } />
      <Route path="/game" component={ Game } />
    </Switch>
  );
}

export default App;
